  getDomi(event: { keyCode: number }, cp: any) {
    if (event.keyCode === 13) {
      this.formSvc.getDom(cp).subscribe((res) => {
        this.options.length = 0;
        // this.filteredOptions.length = 0;
        for (let i = 0; i < res.length; i++) {
          this.options.push(res[i].colonia);
          // this.filteredOptions.push(res[i].colonia);
        }
        if (this.options.length >= 1) {
          this.muni = res[0].municipio;
          window.alert(
            `Aparecen ${this.options.length} colonias con este código postal. ¡Selecciona una!`
          );
        } else {
          window.alert(
            'Este código postal no esta registrado en la base de datos.'
          );
        }
        this.elementDom();
      });
    }
  }

  getDomiEdit(cp: any) {
    this.formSvc.getDom(cp).subscribe((res) => {
      this.options.length = 0;
      // this.filteredOptions.length = 0;
      for (let i = 0; i < res.length; i++) {
        this.options.push(res[i].colonia);
        // this.filteredOptions.push(res[i].colonia);
      }
      this.muni = res[0].municipio;
      this.elementDom();
    });
  }

  elementDom() {
    this.filteredOptions = this.formForm.baseForm
      .get('colonia')!
      .valueChanges.pipe(
        startWith(''),
        map((value) => this.filterData(value))
      );
  }

  private filterData(value: any) {
    const filterValue = value.toLowerCase();
    return this.options.filter((option) =>
      option.toLowerCase().includes(filterValue)
    ); // val.toLowerCase().indexOf(value.toLowerCase()) > -1; });
  }

