  CalculaEdad(id: any): any {
    let edadValue = document.getElementById(`edad-${id}`) as HTMLInputElement;

    let fechaValue = (<HTMLInputElement>(
      document.getElementById(`fechaID-${id}`)
    )).value;

    const today: Date = new Date();
    const birthDate: Date = new Date(fechaValue);
    this.result = today.getFullYear() - birthDate.getFullYear();
    const month: number = today.getMonth() - birthDate.getMonth();
    if (month < 0 || (month === 0 && today.getDate() < birthDate.getDate())) {
      this.result--;
    }

    edadValue.value = this.result.toString();
  }

