      let x = document.getElementById(`nivel_${indice}`) as HTMLDivElement;
      let y = document.getElementById(`otro_${indice}`) as HTMLDivElement;
      let a = document.getElementById(`noEstudia_${indice}`) as HTMLDivElement;
      let b = document.getElementById(`nivel_max_${indice}`) as HTMLDivElement;

      if (this.escol7 === 'Si') {
        x!.style.display = 'inline';
        y!.style.display = 'none';
      } else {
        x!.style.display = 'none';
      }

      if (this.escol7 === 'No') {
        a!.style.display = 'inline';
        b!.style.display = 'inline';
      } else {
        a!.style.display = 'none';
        b!.style.display = 'none';
      }
