  onSave(): void {
    const formValue = this.formForm.baseForm.value;

    const formData = new FormData();
    if (this.file != null) {
      for (var i = 0; i < this.file.length; i++) {
        formData.append('file', this.file[i]);
      }
    }

    if (this.actionTODO == Action.NUEVO) {
      this.formSvc.nuevo(formValue).subscribe((res) => {
        const value = 'nuevo';
        console.log('Nuevo->', res);
        if (
          this.formForm.baseForm.value.cuant_menores >= 1 &&
          this.formForm.baseForm.value.cuant_menores <= 10
        ) {
          // const folioId = this.data?.form?.folio;
          this.ch.forEach((val, indice) => {
            const menorValue = this.menorInto[indice].value;

            let edadValue = document.getElementById(`edad-${indice}`) as HTMLInputElement;
            
            this.menorInto[indice].value.edad_hijo = edadValue.value;

            this.saveMenor(value, menorValue);
          });
        }
        this.saveFile(value, formData);
        // location.reload();
      });
      // window.alert('¡Usuaria creada con éxito!');
    } else {
      const folioId = this.data?.form?.folio;
      this.formSvc.editar(folioId, formValue).subscribe((res) => {
        console.log('Actualiza->', res);
        if (
          this.formForm.baseForm.value.cuant_menores >= 1 &&
          this.formForm.baseForm.value.cuant_menores <= 10
        ) {
          this.ch.forEach((val, indice) => {
            const menorValue = this.menorInto[indice].value;

            const id_menor = this.data?.form?.menores[indice]?.id_menor;

            let edadValue = document.getElementById(`edad-${indice}`) as HTMLInputElement;
            
            this.menorInto[indice].value.edad_hijo = edadValue.value;

            this.editMenor(folioId, id_menor, menorValue);
          });
        }
        if (this.file != null) {
          this.saveFile(folioId, formData);
        }
      });
      // window.alert('¡Usuaria actualizada con éxito!');
    }
  }

